import React from 'react'
import { useQuery, gql } from "@apollo/client";
const FILMS_QUERY = gql`
query GetExchangeRates {
    products {
      id
      title
      image_url
      price
    }
  }
`;

export const Productionpg = () => {
    const { data, loading, error } = useQuery(FILMS_QUERY);
    // console.log(data);

    if (loading) return "Loading...";
    if (error) return <pre>{error.message}</pre>
    return (
        <section class="products-section">
          <div class="product">
              <div class="text-center">
                  <img src="https://d1b929y2mmls08.cloudfront.net/luminskin/img/new-landing-page/moisturizing-balm.png" alt="Premium-Grade Moisturizing Balm"/>
                  </div>
                  <h4 class="title">Premium-Grade Moisturizing Balm</h4>
                  <h2 class="price">USD 29.00</h2>
                  <button class="btn">Add to Cart</button>
                  </div>  
          
        </section>
    )
}
export default Productionpg;
